import React from 'react'
import '../styles/Output.css'

const Output = props => {
    let output = []

    for (let i = 0; i < props.binaryOutput.length; i++) {
        output.push(<span className='BinaryOutput' key={i}>
            {props.binaryOutput[i]}
            <span className='BinaryOutputPopup'>{props.charOutput[i]}</span>
        </span>)
    }

    return(
        <div className='OutputWrapper'>
            { output }
        </div>
    )
}

export default Output
